var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro title bar test object.
 * @param {Object} [props] Initializes a UIAPro TitleBar test object using the supplied property bag.
 * @returns {TitleBar} the description object that was initialized.
 * @class TitleBar
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function TitleBar(props) {
    var titleBarDesc = new UiObjectBaseDescription("TitleBar");

    titleBarDesc._defineByPropertyBag(props);
    return titleBarDesc;
}

/**
 * A UIAPro title bar.
 * @constructor
 * @class TitleBarTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function TitleBarTO(session, description) {
    description = description || TitleBar();
    var titleBarTO = new UiObjectBaseTO("UIAProTitleBar", session, description);

    return titleBarTO;
}

module.exports.TitleBarTO = TitleBarTO;
module.exports.TitleBar = TitleBar;